import React from "react";
import { BrowserRouter, Switch, Route } from "react-router-dom";

import MainMenu from '././components/MainMenu/MainMenu';

import "./App.css";

const App = () => {
    return (
        <div>
            <BrowserRouter>
                <Switch>
                    <Route></Route>
                </Switch>
            </BrowserRouter>
        </div>
    );
};

export default App;
